import GameApp from "./GameApp";
import "./wordGame.css";
import "animate.css";
import { GameProvider } from "../context/GameContext";

function WordGame() {
  return (
    <GameProvider>
      <div className="WordGame">
        <GameApp />
      </div>
    </GameProvider>
  );
}

export default WordGame;
